System.register([],function(e){return{execute:function(){e({_template_label_introduction:"Εισαγωγή",_template_description_introduction:"Το πρότυπο «Εισαγωγή» διαθέτει που σπονδυλωτή διάταξη που είναι έτσι σχεδιασμένη ώστε να αναδεικνύονται οι εικόνες σας και οι σημαντικές επικεφαλίδες.",_template_label_timeline:"Timeline",_template_description_timeline:"Το πρότυπο «Timeline» έχει σχεδιαστεί για την εμφάνιση των εικόνων και του περιεχόμενου σας με χρονολογική σειρά.",_template_label_general:"Γενικά",_template_description_general:"Το πρότυπο «Γενικό» παρέχει τη δυνατότητα κύλισης σε σελίδα μεγάλου μήκους η οποία έχει δημιουργηθεί για την κοινοποίηση των ιστοριών πίσω από το περιεχόμενό σας.",_template_label_snapshot:"Snapshot",_template_description_snapshot:"Το πρότυπο «Snapshot» έχει σχεδιαστεί για την ανάδειξη των συναρπαστικών εικόνων σας με τη χρήση μιας ενότητας, της πλοήγησης σε προβολές και των καρτών.",_template_label_blankscrollable:"Κενό κατά την κύλιση",_template_description_blankscrollable:"Ένα κενό πρότυπο ώστε να δημιουργείτε το σας σχέδιο για σελίδες με δυνατότητα κύλισης.",_template_label_dash:"Dash",_template_description_dash:"Το Dash είναι ένα πρότυπο σχεδιασμένο να εμφανίζει βασικά στοιχεία μέτρησης με χρήση γραφημάτων, χαρτών, καρτών και widget κειμένου.",_template_label_parallax:"Παράλλαξη",_template_description_parallax:"Η επιλογή «Παράλλαξη» σας δίνει τη δυνατότητα προσθήκης μιας διάταξης κεντρικής εικόνας στην εμπειρία σας.",_template_label_epic:"Epic",_template_description_epic:"Το πρότυπο «Epic» παρέχει τη δυνατότητα κύλισης σε σελίδες μεγάλου μήκους και είναι σχεδιασμένο για τη δημιουργία εμπειρίας χρήσης ιστοτόπων.",_template_label_reveal:"Reveal",_template_description_reveal:"Το Reveal σας επιτρέπει να δημιουργήσετε μια περιήγηση αφήγησης τονίζοντας σημαντικά σημεία δεδομένων με τη χρήση πινάκων, γραφημάτων και σελιδοδεικτών.",_template_label_gallery:"Συλλογή",_template_description_gallery:"Το πρότυπο Gallery είναι σχεδιασμένο με μικρογραφίες εικόνων σε περίοπτη θέση για να προβάλλετε το πλούσιο περιεχόμενό σας.",_template_label_summary:"Σύνοψη",_template_description_summary:"Το πρότυπο «Summary» έχει δημιουργηθεί για να χρησιμοποιείται ως δευτερεύουσα ή τελευταία σελίδα που εστιάζει σε μικρές περιγραφές με κείμενο και σε συνδέσμους με δυνατότητα ενεργειών σε πρόσθετο περιεχόμενο.",_template_label_foldable:"Με δυνατότητα αναδίπλωσης",_template_description_foldable:"Το πρότυπο «Με δυνατότητα αναδίπλωσης» έχει μια απλή, ανοιχτή διεπαφή που εστιάζει στον χάρτη και διαθέτει μια κεφαλίδα και ένα widget εργαλείου ελέγχου.",_template_label_launchpad:"Πλαίσιο εκκίνησης",_template_description_launchpad:"Το πρότυπο Launchpad είναι σχεδιασμένο με έμφαση στον χάρτη και έχει ένα widget στοιχείων ελέγχου αγκυρωμένο στο κάτω μέρος της σελίδας.",_template_label_dart:"Βελάκι",_template_description_dart:"Η επιλογή «Βελάκι» είναι ένα πρότυπο που εστιάζει στον χάρτη. Τα widget είναι τοποθετημένα μέσα σε ένα σταθερό πλαίσιο που βρίσκεται στο κάτω μέρος του χάρτη.",_template_label_jewelrybox:"Κοσμηματοθήκη",_template_description_jewelrybox:"Το πρότυπο JewelryBox δημιουργήθηκε για την εμφάνιση στοιχείων σε λίστα σε συνδυασμό με έναν χάρτη.",_template_label_blankfullscreen:"Κενό σε πλήρη οθόνη",_template_description_blankfullscreen:"Ένα κενό πρότυπο ώστε να δημιουργείτε το δικό σας σχέδιο για την προβολή εφαρμογής σε πλήρη οθόνη.",_template_label_quicknavigation:"Γρήγορη πλοήγηση",_template_description_quicknavigation:"Η επιλογή «Γρήγορη πλοήγηση» σας δίνει τη δυνατότητα γρήγορης εναλλαγής πολλών προβολών και σελιδοδεικτών σε μία σελίδα.",_template_label_pocket:"Συρόμενη διάταξη",_template_description_pocket:"Το Pocket είναι ένα πρότυπο με χάρτη και ημι-διαφανές κείμενο υπόδειξης widget. Είναι κατάλληλο για τη δημιουργία εφαρμογών που διαθέτουν ένα κύριο widget που αλληλεπιδρά με το χάρτη.",_template_label_journey:"Journey",_template_description_journey:"Το πρότυπο «Journey» έχει δημιουργηθεί για χρήση του widget σελιδοδεικτών και ενός χάρτη ώστε να παρέχεται εμπειρία διαδραστικής περιήγησης.",_template_label_ribbon:"Ribbon",_template_description_ribbon:"Το πρότυπο «Ribbon» έχει σχεδιαστεί με έμφαση στον σελιδοδείκτη για τον έλεγχο της πλοήγησης στον χάρτη.",_template_label_billboard:"Πίνακας ανακοινώσεων",_template_description_billboard:"Το πρότυπο Billboard δημιουργήθηκε με γνώμονα την απλότητα. Περιέχει έναν χάρτη και ένα widget στοιχείων ελέγχου.",_template_label_monitor:"Monitor",_template_description_monitor:"Η παρακολούθηση ενός προτύπου μονής σελίδας που περιλαμβάνει ένα συνδυασμό widget σχεδιασμένα να οργανώνουν, να παρακολουθούν και να προβάλουν οπτικοποιήσεις δεδομένων με χρήση διάταξης πίνακα στοιχείων ελέγχου.",_template_label_header1:"Κεφαλίδα 1",_template_label_header2:"Κεφαλίδα 2",_template_label_header3:"Κεφαλίδα 3",_template_label_header4:"Κεφαλίδα 4",_template_label_footer1:"Υποσέλιδο 1",_template_label_footer2:"Υποσέλιδο 2",_template_label_footer3:"Υποσέλιδο 3",_template_label_footer4:"Υποσέλιδο 4",_template_label_scenic:"Scenic",_template_description_scenic:"Το πρότυπο Scenic σάς επιτρέπει να δημιουργείτε μια αφηγηματική περιήγηση χρησιμοποιώντας το widget σελιδοδεικτών σε πολυσέλιδη διάταξη.",_template_label_exhibition:"Exhibition",_template_description_exhibition:"Το πρότυπο Exhibition παρέχει πολυσέλιδη διάταξη για τη δημιουργία ενός ιστοτόπου που προβάλλει τις εικόνες και το περιεχόμενό σας χρησιμοποιώντας κάρτες, λίστα και widget χαρτών.",_template_label_indicator:"Δείκτης",_template_description_indicator:"Η ένδειξη παρέχει μια διάταξη πολλών σελίδων με μια μοναδική συλλογή widget σχεδιασμένη για τη δημιουργία σύγχρονων πινάκων στοιχείων ελέγχου.",_template_label_block1:"Μπλοκ 1",_template_label_block2:"Μπλοκ 2",_template_label_block3:"Μπλοκ 3",_template_label_block4:"Μπλοκ 4",_template_label_block5:"Μπλοκ 5",_template_label_block6:"Μπλοκ 6",_template_label_grid1:"Πλέγμα 1",_template_label_grid2:"Πλέγμα 2",_template_label_grid3:"Πλέγμα 3",_template_label_grid4:"Πλέγμα 4",_template_label_blankwindow:"Κενό παράθυρο",_template_label_confirm:"Επιβεβαίωση",_template_label_alert:"Προειδοποίηση",_template_label_simple:"Απλή",_template_label_vogue:"Vogue",_template_label_novel:"Novel",_template_label_sidebar:"Πλαϊνή γραμμή",_template_label_tooltip:"Ετικέτα σύντομης επεξήγησης",_template_label_blank:"Κενή οθόνη",_template_label_centralfloating:"Κεντρική διακύμανση",_template_label_leftfloating:"Αριστερή διακύμανση",_template_label_rightfloating:"Δεξιά διακύμανση",_template_label_rightdock:"Δεξιά αγκύρωση",_template_label_leftdock:"Αριστερή αγκύρωση",_template_label_stream:"Ρεύμα",_template_label_guide:"Οδηγός",_template_label_slideshow:"Παρουσίαση διαφανειών",_template_label_cascade:"Κασκέιντ",_template_label_showcase:"Επισήμανση αντικειμένου",_template_label_portfolio:"Χαρτοφυλάκιο",_template_label_flyer:"Φέιγ βολάν",_template_label_vacation:"Vacation",_template_description_vacation:"Το Vacation είναι ένα πρότυπο που χρησιμοποιεί το γραφικό στοιχείο Fly Controller και χάρτες για να παρέχει έναν διαδραστικό ιστότοπο εκδηλώσεων ταξιδιού.",_template_label_voyage:"Voyage",_template_description_voyage:"Το Voyage είναι ένα πρότυπο που περιλαμβάνει διαδραστικές προγραμματισμένες διαδρομές του γραφικού στοιχείου Fly Controller με δεδομένα τρισδιάστατων χαρτών, μαζί με την απεικόνιση γραφικών στοιχείων κειμένου, εικόνας και κουμπιού για αξιοθέατα περιήγησης.",_template_label_carousel:"Carousel",_template_label_particulars:"Χαρακτηριστικά",_template_label_nopanel:"Κανένα πάνελ",_template_label_dashboard:"Πίνακας εργαλείων",_template_description_dashboard:"Το Dashboard είναι ένα πρότυπο με έναν χάρτη στην επάνω δεξιά γωνία που περιβάλλεται από πέντε παραμετροποιήσιμα κείμενα υπόδειξης, επιτρέποντάς σας να σχεδιάζετε περιεχόμενο με ευκολία.",_template_label_seeker:"Seeker",_template_description_seeker:"Το Seeker είναι ένα πρότυπο σχεδιασμένο ως αρχική ιστοσελίδα. Μπορείτε να χρησιμοποιήσετε το widget αναζήτησης στο επάνω μέρος της σελίδας για να εξαγάγετε γρήγορα τις επιθυμητές πληροφορίες.",_template_label_booking:"Booking",_template_description_booking:"Το πρότυπο Booking παρέχει μια διάταξη πολλών σελίδων με widget αναζήτησης και φιλτραρίσματος για την αναζήτηση δεδομένων. Τα αποτελέσματα αναζήτησης εμφανίζονται σε ξεχωριστή σελίδα, με ένα αναλυτικό παράθυρο που δείχνει περισσότερες πληροφορίες.",_template_label_events:"Συμβάντα",_template_description_events:"Οι Εκδηλώσεις είναι ένα κυλιόμενο πρότυπο που χρησιμοποιεί widget Κάρτας και τη λειτουργία κατάδειξης για να δημιουργήσετε ένα εφέ κατάδειξης σε εστίαση.",_template_label_forecast:"Πρόβλεψη",_template_description_forecast:"Η πρόβλεψη χρησιμοποιεί γραφικά στοιχεία κάρτας, χάρτη και γραφήματος για να αναπαραστήσει ορισμένες από τις σημαντικές πληροφορίες στην αναφορά, μαζί με το γραφικό στοιχείο κλήρωσης για να επιτρέψει στον τελικό χρήστη να επισημάνει ορισμένες ενδιαφέρουσες περιοχές πάνω στο χάρτη.",_template_label_gear:"Εξοπλισμός",_template_description_gear:"Το Gear είναι ένα πρότυπο που διαθέτει ένα widget Ενότητας που αναπαράγεται αυτόματα μέσω τεσσάρων πανομοιότυπων δομημένων προβολών και είναι κατάλληλο για την εμφάνιση διαφορετικού περιεχομένου από την ίδια κατηγορία.",_template_label_route:"Διαδρομή",_template_description_route:"Η Διαδρομή είναι ένα πρότυπο που χρησιμοποιεί τα widget Διάγραμμα, Λίστα και Σελιδοδείκτης για να εισάγει μια σειρά από τόπους και περιλαμβάνει ένα widget Οδηγίες ώστε να επιτρέπει στους χρήστες να οπτικοποιούν ταξίδια σε αυτούς τους τόπους.",_template_label_steps:"Βήματα",_template_label_sketchbook:"Βιβλίο σχεδίων",_template_description_sketchbook:"Το Βιβλίο σχεδίων είναι ένα πρότυπο που παρέχει widget Κάρτας, Χάρτη και Γραφήματος για την αναπαράσταση δεδομένων και ένα widget Σχεδίασης για να επισημάνει ενδιαφέρουσες περιοχές στο χάρτη.",_template_label_blankfullscreenGrid:"Κενό πλέγμα",_template_description_blankfullscreenGrid:"Ένα κενό πρότυπο ώστε να δημιουργείτε το δικό σας σχέδιο σε σελίδα πλέγματος.",_template_label_blankfullscreengrid:"Κενό πλέγμα",_template_description_blankfullscreengrid:"Ένα κενό πρότυπο ώστε να δημιουργείτε το δικό σας σχέδιο σε σελίδα πλέγματος.",_template_label_showplace:"Showplace",_template_description_showplace:"To Showplace είναι ένα πρότυπο με τέσσερα widget Κάρτας ίδιου μεγέθους, τα οποία εμφανίζουν περισσότερες λεπτομέρειες όταν τοποθετείτε τον δείκτη του ποντικιού από πάνω.",_template_label_kit:"Κιτ",_template_description_kit:"Το Κιτ είναι ένα πρότυπο που χρησιμοποιεί τρισδιάστατη εργαλειοθήκη, widget σελιδοδεικτών και χάρτη για την προβολή τρισδιάστατων εφέ για 3D Web προβολές.",_template_label_chronology:"Χρονολογία",_template_description_chronology:"Η Χρονολογία χρησιμοποιεί το widget του Χρονολογίου και του Χάρτη για οπτικοποίηση μοτίβων χρονικών δεδομένων και το widget Εκτύπωσης για εκτύπωση. Δίπλα στον χάρτη, διάφορα γραφήματα δείχνουν στατιστικές πληροφορίες για τις μεταβαλλόμενες χρονικές περιόδους.",_template_label_checkerboard:"Σκακιέρα",_template_description_checkerboard:"Η Σκακιέρα είναι μια σελίδα πλέγματος με ένα widget χάρτη στη μέση και γύρω από αυτό widget σχετικά με τον χάρτη.",_template_label_illustrator:"Illustrator",_template_description_illustrator:"Το πρότυπο Illustrator σάς επιτρέπει να περιγράψετε πλήρως ένα μέρος σε διάταξη πολλών σελίδων με widget Εικόνας, Χρονολογίου και Χάρτη.",_template_label_showroom:"Showroom",_template_description_showroom:"Το Showroom είναι ένα πρότυπο με τέσσερα widget Κάρτας ίδιου μεγέθους, τα οποία εμφανίζουν περισσότερες λεπτομέρειες όταν τοποθετείτε το δείκτη του ποντικιού από πάνω.",_template_label_collage:"Κολάζ",_template_description_collage:"Το Κολάζ είναι ένα πρότυπο σελίδας πλέγματος που εμφανίζει πολλαπλά widget γύρω από το widget του Σταθερού Πίνακα.",_template_label_pamphlet:"Pamphlet",_template_description_pamphlet:"Το Pamphlet είναι ένα πρότυπο μεμονωμένης σελίδας πλήρους οθόνης που εστιάζει στον χάρτη. Το widget Κάρτας λειτουργεί ως πλοήγηση με τις προβολές πλαϊνού πάνελ και τμημάτων για προσομοίωση ξεφυλλίσματος φυλλαδίου.",_template_label_avatarboard:"Avatarboard",_template_description_avatarboard:"Το Avatarboard είναι ένα πρότυπο σελίδας πλέγματος που εμφανίζει πολλαπλά widget Κάρτας με εφέ αιώρησης και ξεφυλλίσματος, και μπορείτε να προσθέσετε περισσότερες λεπτομέρειες στο πίσω μέρος όπως στις εκπαιδευτικές κάρτες.",_template_label_mapflyer:"Mapflyer",_template_description_mapflyer:"Το Mapflyer είναι ένα πρότυπο σελίδας πλέγματος που χρησιμοποιεί το widget Συντεταγμένων και το widget Χάρτη για να εμφανίσει άμεσα πληροφορίες κειμένου και τοποθεσίας από έναν χάρτη.",_template_label_leaflet:"Leaflet",_template_description_leaflet:"Το Leaflet είναι ένα πρότυπο σελίδας πλέγματος με widget Κειμένου και widget Εικόνας εντός πολλαπλών widget Στήλης για κατακόρυφη διάταξη.",_template_label_index:"Ευρετήριο",_template_label_frame:"Πλαίσιο",_template_description_frame:"Το πλαίσιο είναι ένα πρότυπο με σχέδιο σε πλαίσιο που παρέχει μια αίσθηση ορίων και δομής. Με τη συμπερίληψη εικόνων και κειμένου στα πλαίσια, το πρότυπο κάνει το περιεχόμενο να φαίνεται περισσότερο οργανωμένο και εύκολο στην πλοήγηση.",_template_label_multiverse:"Πολυσύμπαν",_template_description_multiverse:"Το πολυσύμπαν είναι ένα πρότυπο για εργασία με πολλές πηγές δεδομένων. Το widget του για προσθήκη δεδομένων απλοποιεί τη διαδικασία εισαγωγής δεδομένων από διάφορες πηγές, δίνοντας τη δυνατότητα στους χρήστες να συγκρίνουν και να αναλύουν πολλές πηγές δεδομένων μέσω χαρτών και πινάκων.",_template_label_elevate:"Αναβάθμιση",_template_description_elevate:"Η αναβάθμιση είναι ένα πρότυπο πολλών σελίδων που δημιουργήθηκε για ενίσχυση του περιεχομένου σας και την παροχή μιας αξέχαστης εμπειρίας χρήστη. Ο απλός σχεδιασμός και η εύκολη στην πλοήγηση δομή το καθιστούν εξαιρετική επιλογή για αφηγήσεις.",_template_label_comparatist:"Comparatist",_template_description_comparatist:"Το Comparatist είναι ένα πρότυπο με ένα διαδραστικό widget Swipe για τη σύγκριση επιπέδων χαρτών δίπλα-δίπλα. Τα widgets πληροφοριών διαγραμμάτων και στοιχείων παρέχουν επίσης μια πιο κατανοητή περιγραφή των υποκείμενων δεδομένων.",_template_label_panorama:"Πανόραμα",_template_description_panorama:"Το Πανόραμα διαθέτει έναν κεντρικό χάρτη που περιβάλλεται από διπλά widgets διαγραμμάτων σε διάταξη κάνναβου. Οι χρήστες μπορούν να αλληλεπιδρούν με widgets Διαγραμμάτων, Λιστών και Φίλτρων για να ερμηνεύσουν τα χαρτογραφημένα δεδομένα από διαφορετικές οπτικές γωνίες.",_template_label_lens:"Φακός",_template_description_lens:"Ο Φακός είναι ένα πρότυπο δυο σελίδων για την εξερεύνηση πολυδιάστατων δεδομένων. Η αρχική σελίδα πλαισιώνει τις πληροφορίες μέσω χαρτών, διαγραμμάτων και φίλτρων. Οι σελιδοδείκτες στη δεύτερη σελίδα επιτρέπουν στους χρήστες να εξετάσουν συγκεκριμένα υποσύνολα δεδομένα.",_template_label_datacollector:"Data collector",_template_description_datacollector:"Η Συλλογή δεδομένων είναι ένα πρότυπο που παρουσιάζει το widget Επεξεργασίας με ένα χάρτη και παρέχει τη δυνατότητα προσθήκης, διαγραφής και επεξεργασίας στοιχείων. Μαζί με το γράφημα, το κείμενο και τη λίστα, εμφανίζει τις βασικές μετρήσεις των ζωντανών δεδομένων σας.",_template_label_tessellate:"Tessellate",_template_description_tessellate:"Το Tesselate είναι ένα πρότυπο σελίδας κύλισης που μοιάζει με ταμπλό και περιλαμβάνει κείμενο, διαγράμματα, πίνακα και άλλα widgets για την εμφάνιση πληροφοριών από μια πηγή δεδομένων.",_template_label_plateau:"Plateau",_template_description_plateau:"Το Plateau είναι ένα βασικό μοντέρνο πρότυπο εφαρμογής που διαθέτει μια επίπεδη γραμμή εργαλείων και ένα δοχείο widget στο επάνω μέρος της σελίδας.",_template_label_preface:"Preface",_template_description_preface:"Το Preface είναι ένα πρότυπο πλήρους οθόνης με διαχωρισμένα χρώματα φόντου. Εμφανίζει βασικές πληροφορίες μέσα από συμπαγή μπλοκ και είναι κατάλληλο για εισαγωγές.",_template_label_sleuth:"Sleuth",_template_description_sleuth:"Το Sleuth διαθέτει ένα μενού πλοήγησης στα αριστερά. Χρησιμοποιήστε τα πλήκτρα βέλους για εναλλαγή μεταξύ των αντικειμένων περιεχομένου. Κάντε κλικ σε κάθε αντικείμενο για να εμφανιστούν οι λεπτομέρειές του στον κάτω δεξιό πίνακα.",_template_label_footnote:"Υποσημείωση",_template_label_iteminfo:"Πληροφορίες αντικειμένου",_template_label_lrsviewer:"Εργαλείο προβολής LRS",_template_description_lrsviewer:" Το LRS Viewer είναι πρότυπο που έχει σχεδιαστεί για εκτέλεση ερωτημάτων, αναζήτηση και βασική ανάλυση σε δεδομένα LRS. Περιλαμβάνει Αναζήτηση ανά διαδρομή, Αναγνώριση LRS, Δυναμική κατάτμηση και άλλα widget. Λειτουργεί με τα δεδομένα αναφοράς ArcGIS Roads and Highways και ArcGIS Pipeline Referencing.",_template_label_lrseditor:"LRS Event Editor",_template_description_lrseditor:"Το LRS Event Editor είναι πρότυπο που έχει σχεδιαστεί για επεξεργασία και ανάλυση δεδομένων LRS. Περιλαμβάνει Προσθήκη συμβάντος σημείου, Προσθήκη συμβάντος γραμμής, Διαίρεση συμβάντος, Συγχώνευση συμβάντων, Δυναμική κατάτμηση και άλλα widget. Λειτουργεί με τα δεδομένα αναφοράς ArcGIS Roads and Highways και ArcGIS Pipeline Referencing.",_template_label_lrs_event_editor:"Πρόγραμμα επεξεργασίας συμβάντων LRS",_template_description_lrs_event_editor:"Το Πρόγραμμα επεξεργασίας συμβάντων LRS είναι ένα πρότυπο που έχει σχεδιαστεί για την επεξεργασία δεδομένων LRS, το οποίο διαθέτει τις λειτουργίες Προσθήκη Συμβάντος Σημείου (Add Point Event), Προσθήκη Συμβάντος Γραμμής (Add Line Event), Διαχωρισμός Συμβάντος (Split Event), Συγχώνευση Συμβάντων (Merge Events) και άλλα γραφικά στοιχεία. Λειτουργεί με τα δεδομένα αναφοράς ArcGIS Roads and Highways και ArcGIS Pipeline Referencing.",_template_label_tab:"Καρτέλα",_template_description_tab:"Η Καρτέλα είναι ένα πρότυπο με επίκεντρο τον χάρτη και καρτέλες στα αριστερά για το άνοιγμα διαφορετικού περιεχομένου της πλαϊνής μπάρας.",_template_label_scrutiny:"Έλεγχος",_template_description_scrutiny:"Το πρότυπο Έλεγχος διαθέτει ένα ευρύ διαφημιστικό πλαίσιο στην κορυφή της σελίδας, με παρόμοια δομημένες ενότητες κύλισης παρακάτω.",_template_label_assessor:"Εκτίμηση",_template_description_assessor:"Η Εκτίμηση προσφέρει μια συμπυκνωμένη επισκόπηση μέσα από τρεις κάρτες προβολής, μια χαρτογραφημένη αναφορά και υποστηρικτικά πινακοειδή δεδομένα.",_template_label_contour:"Ισοϋψής καμπύλη",_template_description_contour:"Η ισοϋψής καμπύλη διευκολύνει την ευρεία επιθεώρηση μέσω μιας ευδιάκριτης προβολής χάρτη που συμπληρώνεται από διαγράμματα και κείμενο πλαισίου παρακάτω.",_template_label_logbook:"Ημερολόγιο συμβάντων",_template_description_logbook:"Το ημερολόγιο συμβάντων είναι ένα πολυσέλιδο πρότυπο που επιτρέπει την πολύπλευρη εξερεύνηση δεδομένων με την καταγραφή βασικών στατιστικών στοιχείων στην αρχική σελίδα και τη διερεύνηση αυτών των δεδομένων σε μεγαλύτερο βάθος με τη χρήση χαρτών, εικόνων, διαγραμμάτων και πινάκων σε άλλες σελίδες κύλισης.",_template_label_recap:"Ανακεφαλαίωση",_template_description_recap:"Η Ανακεφαλαίωση έχει καθαρή και ευκρινή σχεδίαση που εστιάζει κυρίως στο περιεχόμενο. Οι εικόνες και το κείμενο οργανώνονται σε μπλοκ και διαχωρίζονται με κενό χώρο, για σαφή ορισμό των κατηγοριών θεμάτων.",_template_label_skyline:"Γραμμή του ορίζοντα",_template_description_skyline:"Το Skyline είναι μια ένα κομψό πρότυπο σχεδιασμένο για επαγγελματική παρουσίαση υπηρεσιών. Διαθέτει ξεχωριστά τμήματα με κυκλικές εικόνες, τονισμένη παρουσίαση χάρτη στην οθόνη και σελιδοδείκτες σε στυλ γκαλερί.",_template_label_edifice:"Edifice",_template_description_edifice:"Το Edifice είναι ένα επαγγελματικό πρότυπο για την οπτικοποίηση έργων αρχιτεκτονικής και τη διαχείριση κτιρίων.",_template_label_vista:"Vista",_template_description_vista:"Το Vista είναι ένα περιεκτικό πρότυπο δύο σελίδων, σχεδιασμένο για εις βάθος εξερεύνηση κτιρίων.",_template_label_booth:"Θάλαμος",_template_description_booth:"Ο Θάλαμος οργανώνει το περιεχόμενο σε ένα κάνναβο με γραφικά στοιχεία (widget) καρτών, με λεπτομερείς προβολές που είναι προσβάσιμες σε ένα παράθυρο με εξερεύνηση με εστίαση.",_template_label_faq:"Συνήθεις ερωτήσεις",_template_description_faq:"Οι Συνήθεις ερωτήσεις χρησιμοποιούν ένα αναπτυσσόμενο γραφικό στοιχείο (widget) που επιτρέπει στους χρήστες να αναπτύσσουν ένα ή περισσότερα στοιχεία για απλοποιημένη περιήγηση στις Συνήθεις ερωτήσεις ή λεπτομερή προβολή περιεχομένου.",_template_label_catalog:"Κατάλογος",_template_description_catalog:"Ο Κατάλογος παρέχει μια σαφή διάταξη με μια κύρια στήλη με κάρτες περιεχομένου σε στοίβες στα αριστερά, μαζί με μια σταθερή περιοχή περιγραφής και κουμπιά πλοήγησης στα δεξιά, για απλοποιημένη περιήγηση στο περιεχόμενο.",_template_label_prism:"Πρίσμα",_template_description_prism:"Το Πρίσμα σάς παρέχει τη δυνατότητα επίδειξης του περιεχομένου σας μέσα από δύο κομψά σχεδιασμένες σελίδες λεπτομερειών, ενώ παρέχει σαφείς απαντήσεις σε κοινές ερωτήσεις, σε μια καλά οργανωμένη διάταξη για Συνήθεις ερωτήσεις με σκοπό την αύξηση του ενδιαφέροντος των χρηστών.",_template_label_poster:"Αφίσα",_template_tag_Web_page:"Ιστοσελίδα",_template_tag_Scrolling:"Κύλιση",_template_tag_Map_centric:"Χάρτης κεντρικός",_template_tag_Map:"Χάρτης",_template_tag_Title:"Τίτλος",_template_tag_Share:"Κοινοποίηση",_template_tag_Swip:"Σάρωση",_template_tag_Basemap_Gallery:"Συλλογή υποβάθρων",_template_tag_Chart:"Γράφημα",_template_tag_Map_Layers:"Θεματικά επίπεδα χάρτη",_template_tag_Feature_Info:"Πληροφορίες στοιχείου",_template_tag_Legend:"Υπόμνημα",_template_tag_Section:"Ενότητα",_template_tag_View:"Προβολή",_template_tag_Navigation:"Πλοήγηση",_template_tag_Pop_up:"Αναδυόμενο παράθυρο",_template_tag_Accordion:"Πλαϊνό πτυσσόμενο μενού",_template_tag_Divider:"Διαχωριστικό",_template_tag_Blank:"Κενό",_template_tag_Dashboard:"Πίνακας εργαλείων",_template_tag_Logo:"Λογότυπο",_template_tag_Link:"Σύνδεσμος",_template_tag_Filter:"Φίλτρο",_template_tag_Card:"Κάρτα",_template_tag_Query:"Ερώτημα",_template_tag_Spatial_filter:"Χωρικό φίλτρο",_template_tag_Table:"Πίνακας",_template_tag_List:"Λίστα",_template_tag_Bookmark:"Σελιδοδείκτης",_template_tag_Slides:"Διαφάνειες",_template_tag_WAB_classic:"Κλασικό WAB",_template_tag_Fullscreen:"Πλήρης οθόνη",_template_tag_Search:"Αναζήτηση",_template_tag_Sidebar:"Πλαϊνή γραμμή",_template_tag_Widget_Controller:"Εργαλείο ελέγχου του widget",_template_tag_Panel:"Πλαίσιο",_template_tag_Direction:"Κατεύθυνση",_template_tag_Route:"Διαδρομή",_template_tag_Draw:"Σχεδίαση",_template_tag_Measurement:"Μέτρηση",_template_tag_Column:"Στήλη",_template_tag_Bar:"Ράβδος",_template_tag_Fly_Controller:"Εργαλείο ελέγχου πτήσης",_template_tag_Route_fly:"Δρομολόγηση πτήσης",_template_tag_Rotate_fly:"Περιστροφή πτήσης",_template_tag_Edit:"Επεξεργασία",_template_tag_Fullscreen_grid:"Κάνναβος πλήρους οθόνης",_template_tag_Grid:"Πλέγμα",_template_tag_Add_Data:"Προσθήκη δεδομένων",_template_tag_Coordinates:"Συντεταγμένες",_template_tag_Add_to_map:"Προσθήκη στο χάρτη",_template_tag_Building_Explorer:"Building Explorer",_template_tag_Select:"Επιλογή",_template_tag_Splash_window:"Παράθυρο εκκίνησης",_template_tag_Website:"Ιστότοπος",_template_tag_Multipage:"Multipage",_template_tag_Menu:"Μενού",_template_tag_Screen_Group:"Ομάδα οθόνης",_template_tag_Gallery:"Συλλογή",_template_tag_Timeline:"Timeline",_template_tag_Print:"Εκτύπωση",_template_tag_Window:"Παράθυρο",_template_tag_Banner:"Πλαίσιο",_template_tag_Survey:"Τοπογραφία",_template_tag_Pin:"Καρφίτσα",_template_tag_Embed:"Ενσωμάτωση",_template_tag_Flow:"Ροή",_template_tag_Indicator:"Δείκτης",_template_tag_Auto_play:"Αυτόματη αναπαραγωγή",_template_label_beacon:"Μεταδότης",_template_description_beacon:"Ο Μεταδότης είναι ένα πρότυπο σχεδιασμένο για τον συνδυασμό εμπλουτισμένων οπτικοποιήσεων με δομημένες πληροφορίες. Υποστηρίζει μεγάλες δορυφορικές εικόνες, επισημάνσεις κουμπιών και τμήματα διαφανούς κειμένου για να κατευθύνετε τους χρήστες μέσω ενός θέματος ή μιας έννοιας.",_template_label_harbor:"Λιμένας",_template_description_harbor:"Ο Λιμένας είναι ένα χαρτοκεντρικό πρότυπο που διαθέτει συμπτύξιμες ομάδες φίλτρων σε διάταξη πλαϊνού αναπτυσσόμενου μενού. Οι χρήστες μπορούν να αλληλεπιδράσουν με πλαίσια δυναμικών φίλτρων για να ορίσουν ορατά δεδομένα, ενώ τα κουμπιά βάσει περιεχομένου ανοίγουν σχετικά παράθυρα ή πλαίσια για πρόσθετες λεπτομέρειες.",_template_tag_Swipe:"Σάρωση",_template_label_r3new1:"r3new1",_template_description_r3new1:"r3new1.",_template_label_compass:"Πυξίδα",_template_description_compass:"Η Πυξίδα είναι ένα πρότυπο κάνναβου που χρησιμοποιείται για την οργάνωση των δεδομένων σας με έναν χάρτη, πληροφορίες στοιχείου και ένα ευέλικτο πλαίσιο για οπτικοποιήσεις."})}}});